    [],nt"revision_timestamp": "2015-04-20T12:51:47.675071",nt"name": "directory-of-history-of-medicine-collections-dhmc",nt"isopen":
    false,nt"url": null,nt"notes": "The collections described in this Directory
    database provide research and reference services to scholars interested in the history
    of the health sciences. Some of the subjects include: dentistry, veterinary medicine,
    nursing, military medicine, and pharmacy. While the Directory is by no means exhaustive,
    it serves to draw attention to the depth and variety of history of medicine collections
    available to researchers. In the future, we expect that more institutions will wish
    to be included.The database is keyword searchable, with the ability to refine your
    search results by categories: organization type, state/province, country, collection
    subject strengths and organization name.",nt"license_title": null,nt"extras":
